// algorithm from
//      https://wrf.ecse.rpi.edu/Research/Short_Notes/pnpoly.html
//        note, algo assumes final point not same as first point, but data from openstreetmaps has opposite convension
//        so very slight change to algo here
//
// data from
//      https://nominatim.openstreetmap.org/search.php?q=Ontario+Canada&polygon_geojson=1&format=json
//



function isInBox(latitude, longitude, box) {
  const minLatitude = box[0];
  const maxLatitude = box[1];
  const minLongitude = box[2];
  const maxLongitude = box[3];

  return (latitude > minLatitude
    && latitude < maxLatitude
    && longitude > minLongitude
    && longitude < maxLongitude)
}

function isInOntario(latitude, longitude) {
  if (!isInBox(latitude, longitude, ontario.boundingbox))
    return false;

  const polygon = ontario.geojson.coordinates[0];

  var inside = false;
  for (let i = 1, j = 0; i < polygon.length; j = i++) {
    if ((polygon[i][1] > latitude) != (polygon[j][1] > latitude) &&
      longitude < (polygon[j][0] - polygon[i][0]) * (latitude - polygon[i][1]) / (polygon[j][1] - polygon[i][1]) + polygon[i][0]) {
      inside = !inside;
    }
  }

  return inside;
}


